import ExpenseItem from './components/ExpenseItem'

function App() {
  const expenses = [
    {
      'expDate': new Date(2021,2,2),
      'expTitle':'Car Insurance',
      'expAmount':'277.6'
    },
    {
      'expDate': new Date(2022,3,2),
      'expTitle':'New TV Insurance',
      'expAmount':'297.6'
    },
    {
      'expDate': new Date(2023,12,22),
      'expTitle':'Modem Insurance',
      'expAmount':'797.6'
    }
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expTitle={expenses[0].expTitle} expAmount = {expenses[0]}></ExpenseItem>
    </div>
  );
}

export default App;
